124 minuten

goed

met Michael Fassbender, Noomi Rapace en Charlize Theron

Een team van ontdekkingsreizigers gaat op een reis door het universum waarbij ze een ontdekking doen die leidt naar de 
oorsprong van het ontstaan van de mensheid. Hierdoor belanden ze in de gevaarlijkste uithoeken van het universum. Daar zullen 
ze een angstaanjagend gevecht moeten doorstaan om de toekomst van de mensheid te redden.
